                <svg class="animated" id="freepik_stories-manage-money" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 500 500" version="1.1" xmlns:xlink="http://www.w3.org/1999/xlink" xmlns:svgjs="http://svgjs.com/svgjs">
                    <style>
                        svg#freepik_stories-manage-money:not(.animated) .animable {
                            opacity: 0;
                        }

                        svg#freepik_stories-manage-money.animated #freepik--background-simple--inject-43 {
                            animation: 1.5s Infinite linear shake;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-manage-money.animated #freepik--Calculator--inject-43 {
                            animation: 1.5s Infinite linear wind;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-manage-money.animated #freepik--Chart--inject-43 {
                            animation: 1.5s Infinite linear floating;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-manage-money.animated #freepik--magnifying-glass--inject-43 {
                            animation: 1.5s Infinite linear floating;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-manage-money.animated #freepik--piggy-bank--inject-43 {
                            animation: 1.5s Infinite linear floating;
                            animation-delay: 0s;
                        }

                        @keyframes shake {

                            10%,
                            90% {
                                transform: translate3d(-1px, 0, 0);
                            }

                            20%,
                            80% {
                                transform: translate3d(2px, 0, 0);
                            }

                            30%,
                            50%,
                            70% {
                                transform: translate3d(-4px, 0, 0);
                            }

                            40%,
                            60% {
                                transform: translate3d(4px, 0, 0);
                            }
                        }

                        @keyframes wind {
                            0% {
                                transform: rotate(0deg);
                            }

                            25% {
                                transform: rotate(1deg);
                            }

                            75% {
                                transform: rotate(-1deg);
                            }
                        }

                        @keyframes floating {
                            0% {
                                opacity: 1;
                                transform: translateY(0px);
                            }

                            50% {
                                transform: translateY(-10px);
                            }

                            100% {
                                opacity: 1;
                                transform: translateY(0px);
                            }
                        }
